import React from 'react';
import StyledTitle from './Titles';

const PortpolioList = () => {
  return (
    <div>
      <StyledTitle>
        <span>Portpolio List ✨</span>
      </StyledTitle>
      <div>
        <div>
          <span>Front-end(2)</span>
          <span>Publishing()</span>
        </div>
        <div></div>
      </div>
    </div>
  );
};

export default PortpolioList;
